import React from 'react';
import './App.css';
import NavBar from "./NavBar";
import { Paper } from '@material-ui/core';

class Page extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <div>
                <NavBar/><br /><br /><br />
                <Container>
                    <Box my={2}>
                        {[...new Array(12)]
                            .map(
                                () => ''
                            )
                        }
                    </Box>
                </Container>
            </div>
        );
    }
}

export default Page;
